import React, { FunctionComponent } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import SkinList from './pages/skin-list';
import SkinDetail from './pages/skin-detail';
import SkinAdd from './pages/skin-add';
import Home from './pages/home';
import CV from './pages/CV';
import Logo from './components/logo-grid/index';
import PageNotFound from './pages/not-found';
import SkinEdit from './pages/skin-edit';
import UserHeader from './components/user-header';
import openUserSign from './helpers/display-user';

const App: FunctionComponent = () => {

    return (
        <Router>
            <div>
                <nav className="header flex-bet flex-row flex-center-x flex-center-y header w100 zi9 active-in">

                    <Link to="/">
                        <Logo sizeblocs={0.9} hover={true} />
                    </Link>

                    <div className="header__user-part flex-row w20 w50-tab flex-bet">
                        <div className='cta' onClick={() => openUserSign("in")}>
                            <span>
                                Sign In
                            </span>
                        </div>
                        <div className='cta' onClick={() => openUserSign("up")}>
                            <span>
                                Sign Up
                            </span>
                        </div>
                    </div>
                </nav>
                <div className="header__marge"></div>
                <Switch>
                    <Route exact path="/" component={Home}></Route>
                    <Route exact path="/skins" component={SkinList}></Route>
                    <Route exact path="/skins/add" component={SkinAdd}></Route>
                    <Route exact path="/skins/edit/:id" component={SkinEdit}></Route>
                    <Route exact path="/skins/:id" component={SkinDetail}></Route>
                    <Route exact path="/curiculum-vitae" component={CV}></Route>
                    <Route component={PageNotFound}></Route>
                </Switch>

            </div>
            <UserHeader />

        </Router>

    )
}

export default App;
